INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 7, 106001, 0.0, 0, 1, "キャル", 7001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 7, 105901, 0.0, 0, 1, "コッコロ", 7002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 7, 105801, 0.0, 0, 1, "ペコリーヌ", 7003, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 10, 105801, 0.0, 0, 1, "ペコリーヌ", 10001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ジュエルを食べ物…\nいえ、貴重品と交換できます！");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 10, 106001, 0.0, 0, 1, "キャル", 10002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 10, 105901, 0.0, 0, 1, "コッコロ", 10003, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 10, 106401, 0.0, 2104010, 1, "シェフィ", 10004, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00", "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -416.5, 0, 12, 105801, 0.0, 0, 1, "ペコリーヌ", 12001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 13, 106001, 0.0, 0, 1, "キャル", 13001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 13, 105901, 0.0, 0, 1, "コッコロ", 13002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 13, 106401, 0.0, 2104010, 1, "シェフィ", 13003, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00", "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 13, 105801, 0.0, 0, 1, "ペコリーヌ", 13004, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 14, 105901, 0.0, 0, 1, "コッコロ", 14001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 14, 106401, 0.0, 2104010, 1, "シェフィ", 14002, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00", "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 14, 105801, 0.0, 0, 1, "ペコリーヌ", 14003, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 14, 106001, 0.0, 0, 1, "キャル", 14004, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -470.0, 0, 15, 105901, 0.0, 0, 1, "コッコロ", 15001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 16, 106401, 0.0, 2104010, 1, "シェフィ", 16001, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00", "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 16, 105801, 0.0, 0, 1, "ペコリーヌ", 16002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 16, 106001, 0.0, 0, 1, "キャル", 16003, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 16, 105901, 0.0, 0, 1, "コッコロ", 16004, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 17, 105901, 0.0, 0, 1, "コッコロ", 17002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 25, 106001, 0.0, 0, 1, "キャル", 17004, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 25, 105901, 0.0, 0, 1, "コッコロ", 17005, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 25, 106401, 0.0, 2104010, 1, "シェフィ", 17006, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00", "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 25, 105801, 0.0, 0, 1, "ペコリーヌ", 17007, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 18, 190801, 0.0, 0, 1, "カリン", 18001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 18, 190801, 0.0, 0, 2, "カリン", 18002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -470.0, 0, 19, 190801, 0.0, 0, 3, "カリン", 19001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -470.0, 0, 19, 190801, 0.0, 0, 4, "カリン", 19002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -470.0, 0, 20, 190801, 0.0, 0, 5, "カリン", 20001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -470.0, 0, 20, 190801, 0.0, 0, 6, "カリン", 20002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 21, 106001, 0.0, 0, 1, "キャル", 21001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 21, 105901, 0.0, 0, 1, "コッコロ", 21002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 21, 106401, 0.0, 2104010, 1, "シェフィ", 21003, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00", "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 21, 105801, 0.0, 0, 1, "ペコリーヌ", 21004, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -430.0, 0, 22, 190801, 0.0, 0, 1, "カリン", 22001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -430.0, 0, 22, 190801, 0.0, 0, 2, "カリン", 22002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -430.0, 0, 23, 190801, 0.0, 0, 3, "カリン", 23001, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -430.0, 0, 23, 190801, 0.0, 0, 4, "カリン", 23002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2, 8.0, -385.0, 10011, 24, 109001, 4.08, 0, 1, "エリコ（バレンタイン）", 24001, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2, 8.0, -385.0, 10011, 24, 109001, 5.0, 0, 2, "エリコ（バレンタイン）", 24002, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2, 8.0, -385.0, 10011, 24, 109001, 10.11, 0, 3, "エリコ（バレンタイン）", 24003, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2, 8.0, -385.0, 10011, 24, 109001, 4.0, 0, 4, "エリコ（バレンタイン）", 24004, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2, 8.0, -385.0, 10011, 24, 109001, 6.0, 0, 5, "エリコ（バレンタイン）", 24005, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, 0.0, 10011, 24, 109002, 0.0, 0, 6, "エリコ（バレンタイン）", 24006, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, 0.0, 10011, 24, 109002, 0.0, 0, 7, "エリコ（バレンタイン）", 24007, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, 0.0, 10011, 24, 109002, 0.0, 0, 8, "エリコ（バレンタイン）", 24008, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, 0.0, 10011, 24, 109002, 0.0, 0, 9, "エリコ（バレンタイン）", 24009, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, 0.0, 10011, 24, 109002, 0.0, 0, 10, "エリコ（バレンタイン）", 24010, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2, 8.0, -385.0, 10011, 24, 109101, 2.12, 0, 1, "シズル（バレンタイン）", 24011, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2, 8.0, -385.0, 10011, 24, 109101, 4.19, 0, 2, "シズル（バレンタイン）", 24012, "2030/12/17 14:59:59", 5, "2019/01/31 12:00:00", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (4, 8.0, -385.0, 10011, 24, 109101, 2.3, 0, 3, "シズル（バレンタイン）", 24013, "2030/12/17 14:59:59", 2, "2019/01/31 12:00:00", "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, 0.0, 10011, 24, 109102, 0.0, 0, 4, "シズル（バレンタイン）", 24014, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2, 8.0, -385.0, 10011, 24, 109101, 5.23, 0, 5, "シズル（バレンタイン）", 24015, "2030/12/17 14:59:59", 5, "2019/01/31 12:00:00", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, 0.0, 10011, 24, 109102, 0.0, 0, 6, "シズル（バレンタイン）", 24016, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2, 8.0, -385.0, 10011, 24, 109101, 5.01, 0, 7, "シズル（バレンタイン）", 24017, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, 0.0, 10011, 24, 109102, 0.0, 0, 8, "シズル（バレンタイン）", 24018, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, 0.0, 10011, 24, 109102, 0.0, 0, 9, "シズル（バレンタイン）", 24019, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, 0.0, 10011, 24, 109102, 0.0, 0, 10, "シズル（バレンタイン）", 24020, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 26, 106401, 0.0, 2104010, 1, "シェフィ", 26001, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00", "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪");
