INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 26, 106001, 0.0, 0, 1, "キャル", 26003, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 26, 105901, 0.0, 0, 1, "コッコロ", 26004, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 27, 106401, 0.0, 2104010, 1, "シェフィ", 27001, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00", "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 27, 105801, 0.0, 0, 1, "ペコリーヌ", 27002, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！");
