INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 27, 105901, 0.0, 0, 1, "コッコロ", 27004, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。");
