INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -363.0, 0, 43, 106001, 0.0, 0, 1, "キャル", 43003, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (1, 0.0, -416.5, 0, 44, 123001, 0.0, 0, 1, "アメス", 43004, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪");
